style.css:
@-moz-document domain("forum.pts-truck.pl") {
    body {
        background: #141518;
    }
    #container {
        color: #f6f7f9;
    }
    #posts_container {
        background: #202020;
    }
    .post_body {
        color: #dddddd;
    }
    .navigation .active {
        color: #dddddd;
    }
    .forumdesc_d2 {
        color: #000000;
    }
    .codeblock {
        color: #000000;
    }
    .post .post_author div.author_statistics,
    div.author_information,
    .post .post_head span.post_date,
    .post .post_head span.edited_post {
        color: #DDDDDD;
    }
}
